import { useState, useEffect } from 'react';
const Fetch = () => {
  const [photos, setPhotos] = useState([]);
  useEffect(() => {
    fetch('http://localhost:5000')
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setPhotos(data);
      });
  }, []);
  return (
    <div>
      
      {data.map((item) => (
  <tr>
    <td key={item.id}>{item.fornamn}</td>
    <td key={item.id}>{item.efternamn}</td>
    <td key={item.id}>{item.personnummer}</td>
    <td key={item.id}>{item.tidin}</td>
  </tr>
    ))}
    </div>
  );
};
export default Fetch;
